import React from 'react'
import { Image, StyleSheet, View, Text } from 'react-native'

const Statistics = () => {
    const estadisticas = "https://i.postimg.cc/5yBDhnN8/afe52b2b-5ccc-423d-ae6d-b4b813e3d2db.png";
    return (
        <View style={styles.container}>
            <View>
                <Text style={styles.text}>ESTAD√çSTICAS</Text>
                <Image source={{ uri: estadisticas }} style={styles.estadisticas} />
            </View>
        </View>
    )
}

const styles = StyleSheet.create({
    container: {
        flex: 5,
        alignItems: 'center',
        backgroundColor: '#DEE1E6',
        marginTop: 35,
        marginLeft: 25,
        marginRight: 25,
        marginBottom: 35,
        borderRadius:10
    },
    text:{
        marginTop: 25,
        color: 'black',
        fontSize: 20,
        textAlign: 'center',
        fontWeight: 'bold',        
    },
    estadisticas: {
        marginTop: 30,
        width: 250,
        height: 300, // Ajusta la altura deseada para la imagen
    },
})

export default Statistics;
